const axios = require("axios");

const options = {
  method: 'GET',
  url: 'https://menu7.p.rapidapi.com/menu-api/api/manage-locks',
  params: {
    filter: '{\n  "_sort": [],\n  "_order": [\n    "ASC"\n  ],\n  "_start": 0,\n  "_end": 0,\n  "instance": "",\n  "product": ""\n}'
  },
  headers: {
    Authorization: 'undefined',
    'X-RapidAPI-Key': 'e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6',
    'X-RapidAPI-Host': 'menu7.p.rapidapi.com'
  }
};

axios.request(options).then(function (response) {
  const items = response.data;
  const cards = items.map((item) => {
    return `
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">${item.name}</h5>
          <p class="card-text">${item.description}</p>
        </div>
      </div>
    `;
  });
  const cardsHtml = cards.join('');
  document.getElementById('cards').innerHTML = cardsHtml;
}).catch(function (error) {
  console.error(error);
});
